const addShadowToDOM = () => {

    if (document.querySelector("dribble-shadow")) {
        shadow.style.display = "block";

        const nextSibling = body ?? shadow.nextElementSibling;

        nextSibling.style.marginLeft = "350px";

        return;
    }

    if (!body) {
        const head = html.querySelector("head");
        head.insertAdjacentElement(shadow);
        shadow.nextElementSibling.style.marginLeft = "350px";
        shadow.style.display = "block";

    } else {
        html.insertBefore(shadow, body);
        body.style.marginLeft = "350px";
        shadow.style.display = "block";
    }

}

const removeShadowFromDOM = () => {

    const nextSibling = body ?? shadow.nextElementSibling;

    nextSibling.style.marginLeft = "0";

    shadow.style.display = "none"
};

