async function listenToEditRule(data, index) {

    const item = data[index];

    shadow.shadowRoot.querySelector('button[id=edit-rule]')?.addEventListener('click', (e) => {

        uiPanel.innerHTML = editRuleForm(item);

        shadow.shadowRoot.querySelector('button[id=cancel-edit]')?.addEventListener('click', (e) => addDashboard())

        const form = shadow.shadowRoot.querySelector('form');

        form?.addEventListener('submit', (e) => {

            const formContent = (selector) => e.target.querySelector(selector).value.toString().split(';')

            chrome.runtime.sendMessage({
                type: "SAVE_EDIT", site: document.location.origin, data: {
                    index,
                    rule: {
                        itemsSelectors: formContent('input#container'),
                        searchTerms: formContent('input#terms'),
                        action: "DELETE",
                        subPages: [
                            {
                                linksToFollowSelectors: formContent('input#links-to-follow'),
                                itemsSelectors: formContent('input#subpage-containers'),
                                searchTerms: formContent('input#subpage-terms'),
                            }
                        ]
                    }
                }
            })

        });
    })
}

function updateRuleViewDOM(data, IncomingPagination) {
    const pagination = { ...IncomingPagination }

    uiPanel.innerHTML = `
        <div class="view-items">
            <div class="pagination">
                ${pagination.current === 1 ? '<button id="return-home">Back to dashboard</button>' : '<button id="prev-item" type="text">Previous</button>'}
                <div class="pagination-status">${pagination.current} of ${pagination.total}</div>
                ${pagination.current === data.length ? '<div></div>' : '<button id="next-item" type="text">Next</button>'}
            </div>
            <div class="view-item">
                ${generateViewRule(data[pagination.current - 1])}
            </div>
        </div>
    `;

    listenToEditRule(data, pagination.current - 1);
    listenToDeleteRule(pagination.current - 1);

    shadow.shadowRoot.querySelector('button[id=return-home]')?.addEventListener('click', (e) => {
        addDashboard();
    })

    pagination.current > 1 && shadow.shadowRoot.querySelector('button[id*=prev-item]')?.addEventListener('click', (e) => {
        if (pagination.current === 1) return;

        pagination.current -= 1;
        updateRuleViewDOM(data, pagination)
    })

    pagination.current < pagination.total && shadow.shadowRoot.querySelector('button[id*=next-item]')?.addEventListener('click', (e) => {
        if (pagination.current === pagination.total) return;

        pagination.current += 1;
        updateRuleViewDOM(data, pagination)
    })
}

async function RenderViewRules(current = 1) {

    chrome.runtime.sendMessage({ type: "GET_RULES", site: document.location.origin, }, async (response) => {
        const { data } = response;

        const pagination = {
            current: current,
            total: data.length
        }

        if (!data?.length) {
            addDashboard();
        }
        else {
            updateRuleViewDOM(data, pagination);
        }
    })
}


