chrome.runtime.onMessage.addListener((message, sender, respond) => {

    const { type, shouldShow } = message ?? {};

    if (type === "TOGGLE_UI") {

        if (shouldShow) {
            addShadowToDOM();
        } else {
            removeShadowFromDOM();
        }
    }
})